package com.testwa.distest.server.entity;import com.testwa.core.base.mybatis.annotation.Column;import com.testwa.core.base.bo.BaseEntity;import lombok.Data;import java.util.Date;@Datapublic class ProjectBase extends BaseEntity {    @Column(name = "project_id")    private Long projectId;    @Column(name = "create_time")    private Date createTime;    @Column(name = "update_time")    private Date updateTime;    @Column(name = "create_by")    private Long createBy;    @Column(name = "update_by")    private Long updateBy;    public void setCreateTime(Date createTime) {        this.createTime = createTime;        this.updateTime = createTime;    }    public void setCreateBy(Long createBy) {        this.createBy = createBy;        this.updateBy = createBy;    }}